import ExpenseItem from "./ExpenseItem";

const ExpenseList = (props) => {
  let expensesContent = <p>No expenses found.</p>;

  if (props.items.length.length > 0) {
  }

  return (
    <ul>
      {props.items.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))}
    </ul>
  );
};

export default ExpenseList;
